import React from 'react'
import './Recommended.css'
import Rental from './Rental'
import Button from './Button'
import $ from 'jquery'


class Recommended extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            data1: "fa-solid fa-angle-left",
            data2: "fa-solid fa-angle-right"
        }
        
    
    }

    
   render(){ 
    return(
        <div id="rec-stays">
            
            <h1>Recommended Stays</h1> 
            
            <div id="c-container">
                <div className="carousel">
                    <Button icon = { this.state.data1 }/>   
                    <Rental />
                    <Rental />
                    <Rental />
                    <Rental />
                    <Rental />
                    <Rental />
                    <Rental />
                    <Rental />
                    <Rental />
                    <Rental />
                    <Button icon = { this.state.data2 }/>
                 </div> 
            </div> 
           
                 
        </div>
    );
    }
}

$(function(){
    $('#post').innerWidth=$('.carousel').innerWidth()/5;
});

export default Recommended;
